import { Button, FormControl, Grid, InputLabel, MenuItem, Paper, Select, Table, TableBody, TableCell, TableContainer, TableRow, TextField } from '@mui/material';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';
import React, { useState } from 'react';
import InputMask from 'react-input-mask';

const PaginaEnderecos = () => {
    const [tipoPessoa, setTipoPessoa] = useState('pessoaFisica');
    const [inputNome, setInputNome] = useState('');
    const [inputCpf, setInputCpf] = useState('');
    const [enderecos, setEnderecos] = useState([{ id: 1, endereco: "Rua Belo Horizonte, 2830", residencial: true }, { endereco: "Rua Belo Horizonte, 2830", residencial: false }]);
    const [open, setOpen] = React.useState(false);

    const handleChange = (event) => {
        setTipoPessoa(event.target.value);
    };

    const handleAddEndereco = () => {
        setEnderecos([...enderecos, { endereco: 'Novo Endereço' }]);
    };

    const handleRemoveEndereco = (index) => {
        const updatedEnderecos = [...enderecos];
        updatedEnderecos.splice(index, 1);
        setEnderecos(updatedEnderecos);
    };

    const handleClickOpen = () => {
        setOpen(true);
    };

    const handleClose = () => {
        setOpen(false);
    };

    return (
        <div className="user-details">
            <h1>Inserir novo usuário</h1>
            <Grid container spacing={2} alignItems="center">
                <Grid item xs={4}>
                    <FormControl fullWidth>
                        <InputLabel required={true} id="tipo-pessoa-label">Tipo de pessoa</InputLabel>
                        <Select
                            labelId="tipo-pessoa-label"
                            id="tipo-pessoa"
                            value={tipoPessoa}
                            onChange={handleChange}
                        >
                            <MenuItem value="pessoaFisica">Pessoa Física</MenuItem>
                            <MenuItem value="pessoaJuridica">Pessoa Jurídica</MenuItem>
                        </Select>
                    </FormControl>
                </Grid>
                <Grid item xs={4}>
                    <TextField
                        label="Nome"
                        required={true}
                        fullWidth
                        value={inputNome}
                        onChange={(e) => setInputNome(e.target.value)}
                    />
                </Grid>
                <Grid item xs={4}>
                    <InputMask
                        mask="999.999.999-99"
                        value={inputCpf}
                        onChange={(e) => setInputCpf(e.target.value)}
                    >
                        {() => <TextField
                        label="CPF"
                        required={true}
                        fullWidth
                        // value={inputCpf}
                        // onChange={(e) => setInputCpf(e.target.value)}
                    />}
                    </InputMask>

                </Grid>

                <Grid item xs={4}>
                    <TextField label="Telefone" fullWidth required={true} />
                </Grid>
                <Grid item xs={4}>
                    <TextField label="E-mail" fullWidth />
                </Grid>
            </Grid>

            <div className='enderecos-title'>
                <h3>Endereços</h3>
                <div className='btn-novo-enderco'>
                    <Button variant="contained" color="primary">Adicionar endereço</Button>
                </div>
            </div>

            <TableContainer component={Paper}>
                <Table>
                    <TableBody>
                        {enderecos.map((endereco) => (
                            <TableRow key={endereco.id}>
                                <TableCell>{endereco.endereco}</TableCell>
                                <TableCell className='buttons-endereco'>
                                    <Button variant="contained" color="primary">Editar</Button>
                                    <Button className='btn-remove' variant="contained" onClick={handleClickOpen} color="error">Excluir</Button>
                                </TableCell>
                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>

            <Button variant="contained" className='btn-salvar-usuario' color="primary">Salvar</Button>

            <Dialog
                open={open}
                onClose={handleClose}
                aria-labelledby="alert-dialog-title"
                aria-describedby="alert-dialog-description"
            >
                <DialogTitle id="alert-dialog-title">
                    {"Deseja realmente excluir este endereço?"}
                </DialogTitle>
                <DialogContent>
                    <DialogContentText id="alert-dialog-description">
                        Esta ação é irreversível
                    </DialogContentText>
                </DialogContent>
                <DialogActions>
                    <Button onClick={handleClose}>Não</Button>
                    <Button onClick={handleClose} autoFocus> Sim </Button>
                </DialogActions>
            </Dialog>
        </div>
    );
};

export default PaginaEnderecos;
